export enum Scenes {
  LOADING = 'LOADING',
  START = 'START',
  GAME = 'GAME',
  ENDCARD = 'ENDCARD',
  SHARE = 'SHARE',
  PRIZE = 'PRIZE'
}

export enum AssetTypes {
  Texture,
  JSON,
  Audio
}

export class TextureInfo {
  name: string;
  texture: any;

  constructor(name: string, texture: any) {
    this.name = name;
    this.texture = texture;
  }
}

export class ObjectInfo {
  name: string;
  texture: any;
  hull: any;

  constructor(name: string, texture: any, hull: any) {
    this.name = name;
    this.texture = texture;
    this.hull = hull;
  }
}

export class AudioInfo {
  name: string;
  audio: Blob;
  playbackspeed: number;

  constructor(name: string, audio: Blob, playbackspeed: number) {
    this.name = name;
    this.audio = audio;
    this.playbackspeed = playbackspeed;
  }
}

/**
 * A Library that downloads Assets from a server and places them in local storage to use for the initialization of the Application.
 */
export class AssetLibrary {
  private adress: string;

  public initialized = false;
  public settingsLoaded = false;

  private textures: TextureInfo[] = [];
  private objects: ObjectInfo[] = [];
  private audio: AudioInfo[] = [];

  constructor(adress?: string) {
    if (adress !== undefined) {
      this.adress = adress;
    } else {
      this.adress = 'http://cooldgsinterns.0loading.com/assets/';
    }
  }

  /**
   * Sets the file server adress, set this to the asset folder for a different company
   * @param adress The adress of the file server to look for assets in.
   *
   * @todo Convert this to have a static fileserver-link and edit the location in the fileserver.
   */
  public SetAdress(adress: string) {
    this.adress = adress;
  }

  /**
   * Get any asset of any type from the AssetLibrary by name.
   * @param assetName The name of the asset to load.
   */
  public GetAsset(assetName: string) {
    var isTexture = this.GetTexture(assetName);
    if (isTexture !== null) {
      return isTexture;
    }
    var isObject = this.GetObject(assetName);
    if (isObject !== null) {
      return isObject;
    }
    var isAudio = this.GetAudio(assetName);
    if (isAudio !== null) {
      return isAudio;
    }
    return null;
  }

  /**
   * Loads a texture in from the server
   * @param assetInfo Information of the texture to load, this information gets read from the JSON.
   */
  public async LoadTexture(assetInfo: { ingame: string; instorage: string; scale?: { width: number; height: number }; angle?: number }) {
    for (var q = 0; q < this.textures.length; q++) {
      if (this.textures[q].name === assetInfo.ingame) {
        return;
      }
    }

    var texture = await this.GetAssetFromServer(assetInfo.instorage, AssetTypes.Texture).then(function(result: any) {
      if (result == null) {
        console.error('Tried to load an image that does not exist.');
      } else {
        return result;
      }
    });

    var scale;
    if (assetInfo.scale === undefined) {
      scale = { width: 1, height: 1 };
    } else {
      scale = assetInfo.scale;
    }

    var angle;
    if (assetInfo.angle === undefined) {
      angle = 0;
    } else {
      angle = assetInfo.angle;
    }

    this.textures.push(new TextureInfo(assetInfo.ingame, texture));
  }

  /**
   * Checks wether all textures have been loaded.
   * @param textures List of the textures to check
   */
  public TexturesLoaded(textures: { ingame: string; instorage: string }[]) {
    for (var q = 0; q < textures.length; q++) {
      var found = false;
      for (var w = 0; w < this.textures.length; w++) {
        if (textures[q].ingame == this.textures[w].name) found = true;
      }
      if (!found) return false;
    }
    return true;
  }

  /**
   * Get any texture of the AssetLibrary by name.
   * @param name The name of the texture to get from the AssetLibrary.
   */
  public GetTexture(name: string) {
    for (var q = 0; q < this.textures.length; q++) {
      if (this.textures[q].name == name) {
        return this.textures[q];
      }
    }

    return new TextureInfo('Error 404', null);
  }

  /**
   * Loads a object in from the server, it downloads a Sprite and a Data file.
   * @param assetInfo Information of the object to load, this information gets read from the JSON.
   */
  public async LoadObject(assetInfo: { ingame: string; spriteinstorage: string; datainstorage: string }) {
    for (var q = 0; q < this.objects.length; q++) {
      if (this.objects[q].name === assetInfo.ingame) {
        return;
      }
    }

    var texture = await this.GetAssetFromServer(assetInfo.spriteinstorage, AssetTypes.Texture).then(function(result: any) {
      if (result == null) {
        // TODO: get standard texture from local storage?
      }
      return result;
    });

    var data = await this.GetAssetFromServer(assetInfo.datainstorage, AssetTypes.JSON).then(function(result: any) {
      if (result == null) {
        console.error('Object does not exist in the storage. Try generating a new JSON.');
        return { hull: [], size: { width: 0, height: 0 } };
      } else {
        return { hull: result.hull, size: result.size };
      }
    });

    this.objects.push(new ObjectInfo(assetInfo.ingame, texture, data.hull));
  }

  /**
   * Checks wether all objects have been loaded.
   * @param objects List of the objects to check
   */
  public ObjectsLoaded(objects: { ingame: string; instorage: string }[]) {
    for (var q = 0; q < objects.length; q++) {
      var found = false;
      for (var w = 0; w < this.objects.length; w++) {
        if (objects[q].ingame == this.objects[w].name) found = true;
      }
      if (!found) return false;
    }
    return true;
  }

  /**
   * Get any object of the AssetLibrary by name.
   * @param name The name of the object to get from the AssetLibrary.
   */
  public GetObject(name: string) {
    for (var q = 0; q < this.objects.length; q++) {
      if (this.objects[q].name == name) {
        return this.objects[q];
      }
    }

    return new ObjectInfo('Error 404', new Blob(), null);
  }

  /**
   * Loads audio in from the server
   * @param assetInfo Information of the audio to load, this information gets read from the JSON.
   */
  public async LoadAudio(assetInfo: { ingame: string; instorage: string; playbackspeed: number }) {
    for (var q = 0; q < this.objects.length; q++) {
      if (this.objects[q].name === assetInfo.ingame) {
        return;
      }
    }

    var audio = await this.GetAssetFromServer(assetInfo.instorage, AssetTypes.Audio).then(function(result: any) {
      return result;
    });

    this.audio.push(new AudioInfo(assetInfo.ingame, audio, assetInfo.playbackspeed));
  }

  /**
   * Checks wether all audio has been loaded.
   * @param audio List of the audio to check
   */
  public AudioLoaded(audio: { ingame: string; instorage: string }[]) {
    for (var q = 0; q < audio.length; q++) {
      var found = false;
      for (var w = 0; w < this.audio.length; w++) {
        if (audio[q].ingame == this.audio[w].name) found = true;
      }
      if (!found) return false;
    }
    return true;
  }

  /**
   * Get audio of the AssetLibrary by name.
   * @param name The name of the audio to get from the AssetLibrary.
   */
  public GetAudio(name: string) {
    for (var q = 0; q < this.audio.length; q++) {
      if (this.audio[q].name == name) {
        return this.audio[q];
      }
    }

    return new AudioInfo('Error 404', new Blob(), 0);
  }

  /**
   * Downloads any asset from the server
   * @param name Filename of the asset to download
   * @param type Filetype of the asset to download
   */
  public async GetAssetFromServer(name: string, type: AssetTypes) {
    var adress = this.adress;
    return new Promise(function(resolve, reject) {
      var assetUrl = adress + name;

      var request = new XMLHttpRequest();
      request.open('GET', assetUrl);

      switch (type) {
        case AssetTypes.Texture:
          request.responseType = 'blob';
          break;
        case AssetTypes.Audio:
          request.responseType = 'blob';
          break;
        default:
          break;
      }

      
      request.setRequestHeader('Cache-Control', 'no-cache');
      //request.setRequestHeader('Pragma', 'no-cache');
      //request.setRequestHeader('Expires', '0');

      request.onload = function() {
        if (request.status == 200) {
          switch (type) {
            case AssetTypes.Texture:
              let reader = new FileReader();
              reader.readAsDataURL(request.response);

              reader.onload = function() {
                resolve(reader.result);
              };
              break;
            case AssetTypes.JSON:
              resolve(JSON.parse(request.response));
              break;
            case AssetTypes.Audio:
              resolve(request.response);
              break;
            default:
              console.error('Type not found');
              break;
          }
        }
      };

      request.onerror = function() {
        if (request.status == 404) {
          resolve(null);
        }
      };
      request.send();
    });
  }
}
